import { Component } from '@angular/core';
import { MatDialog } from '@angular/material/dialog';
import { CourseService } from '../../services/course.service';

@Component({
  selector: 'app-add-schedules',

  templateUrl: './add-schedules.component.html',
  styleUrl: './add-schedules.component.css'
})
export class AddSchedulesComponent {
  constructor(private serv: CourseService, private dialog: MatDialog) { }


  Schedules = new FormGroup({
    name: new FormControl('', Validators.required),
    code: new FormControl('', Validators.required),
    day: new FormControl(''),
    sTime: new FormControl('', Validators.required),
    eTime: new FormControl('', Validators.required)

  });

  get name() {
    return this.courses.get('name') as FormControl;
  }
  get code() {
    return this.courses.get('code') as FormControl;
  }
  get day() {
    return this.courses.get('day') as FormControl;
  }
  get sTime() {
    return this.courses.get('sTime') as FormControl;
  }
  get eTime() {
    return this.courses.get('eTime') as FormControl;
  }
  addSchedules() {
    this.serv.addSchedules([
      this.courses.value.name,
      this.courses.value.code,
      this.courses.value.day,
      this.courses.value.sTime,
      this.courses.value.eTime,

    ]).subscribe(res => {
      if (res == "AlreadyExist") {
        alert("This course already exist !");
        this.dialog.closeAll();

      }
      else {
        alert("Successfully added !");
        this.dialog.closeAll();
      }
    });

  }
}
<form [formGroup]="Schedules"></form>

<h1 mat-dialog-title>Add New Schedules</h1>

<div mat-dialog-content class="style">


    <mat-form-field>
        <mat-label>Course Code</mat-label>
        <input matInput placeholder="" formControlName="code">
    </mat-form-field>


    <mat-form-field>
        <mat-label>Instructors Name </mat-label>
        <input matInput placeholder="" formControlName="name">
    </mat-form-field>

    <mat-form-field>
        <mat-label>Select Day</mat-label>
        <mat-select>
            <mat-option value="mon">Monday</mat-option>
            <mat-option value="tues">Tuesday</mat-option>
            <mat-option value="wed">Wednesday</mat-option>
            <mat-option value="thur">Thursday</mat-option>
            <mat-option value="fri">Friday</mat-option>
            <mat-option value="sat">Saturday</mat-option>
            <mat-option value="sun">Sunday</mat-option>
        </mat-select>
    </mat-form-field>


    <mat-form-field>
        <mat-label>Start Time</mat-label>
        <input matInput
               name="selected_time_A"
               [ngxMatTimepicker]="pickerA"
               placeholder="4:00 PM"
               readonly formControlName="sTime"/>
        <mat-icon matSuffix
                  (click)="pickerA.open()">
        </mat-icon>
    </mat-form-field>
    <ngx-mat-timepicker #pickerA></ngx-mat-timepicker>

    <mat-form-field>
        <mat-label>End Time</mat-label>
        <input matInput
               name="selected_time_B"
               [ngxMatTimepicker]="pickerB"
               placeholder="4:00 PM"
               readonly formControlName="eTime"/>
        <mat-icon matSuffix
                  (click)="pickerB.open()">
        </mat-icon>
    </mat-form-field>
    <ngx-mat-timepicker #pickerB></ngx-mat-timepicker>

    <div class="example-button-row">
        <button mat-raised-button>Add</button>
    </div>

</div>
